import React, { Component } from 'react';

class Test extends Component {
    test_arrow = (array) => {
        console.log(array[0]);
    };

    render() {
        return <div>
            HAHAHA
            {this.test_arrow(array('prout', 'meuh'))};
        </div>;
    }
}

export default Test;
